import React, { Component } from 'react';

import Navbar from './components/Navbar';
import Carousel from './components/Carousel';
import Footer from './components/Footer';

import Home from './pages/Home';
 class App extends Component {
  render() {
    return (
      <div>
        <Navbar/>
        <Carousel/>
        <Home/>

        <Footer/>
      </div>
    )
  }
}
export default App;
